// Add item to cart
cy.get("[data-test='add-to-cart-sauce-labs-backpack']").click();
cy.get(".shopping_cart_link").click();
cy.get("[data-test='checkout']").click();
// Try to continue without filling form
cy.get("[data-test='continue']").click();
cy.get("[data-test='error']").should("contain.text", "Error: First Name is required");
// Fill only first name
cy.get("[data-test='firstName']").type("Moizzz");
cy.get("[data-test='continue']").click();
cy.get("[data-test='error']").should("contain.text", "Error: Last Name is required");

// Add multiple products
cy.get("[data-test='add-to-cart-sauce-labs-backpack']").click();
cy.get("[data-test='add-to-cart-sauce-labs-bike-light']").click();
// Go to cart
cy.get(".shopping_cart_link").click();
cy.get("[data-test='checkout']").click();
// Fill in checkout info
cy.get("[data-test='firstName']").type("Moiz");
cy.get("[data-test='lastName']").type("Ahmad");
cy.get("[data-test='postalCode']").type("12345");
cy.get("[data-test='continue']").click();
